  false,\n\t\"url\": null,\n\t\"notes\": \"Environmental contaminants including organochlorine
  compounds (e.g., polychlorinated biphenyls (PCBs), dichlorodiphenyldichloroethylene
  (DDE)), polybrominated diphenyl ether (PBDE), and mercury were measured in 16 nonu2010viable
  or abandoned bald eagle Haliaeetus leucocephalus eggs and 65 nestling blood samples
  collected between 2000 and 2012 from the Maine coast. The study objectives were
  to compare current contaminant levels in eggs and blood to suggested toxicity threshold
  levels reported in the scientific literature and to two previous Maine bald eagle
  investigations conducted in the 1990s.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
